import React, { useEffect, useState } from "react";
import Spacing from "../../Spacing";
import Div from "../../Div";
import { pageTitle } from "../../../helper";
import axios from "axios";

function Contact() {
  const initialState = {
    username: "",
    email: "",
    numtel: "",
    image: "",
  };
  pageTitle("Contact");
  const [Contact, setContact] = useState([]);
  const [Cont, setCont] = useState(initialState);
  useEffect(() => {
    const getContact = async () => {
      const res = await axios.get("/contact/getcontact");
      console.log("contact",res.data.response.response)
      setContact(res.data.response.response);
    };
    getContact();
  }, []);

  return (
    <>
      <Spacing lg="110" md="80" />
      <Div className="container">
        <Div className="col-lg-12">
          <table>
            <tr>
              <th>Nom et prénom</th>
              <th>Email</th>
              <th>Numéro de téléphone</th>
              <th>Message de description</th>
              <th>CV </th>
            </tr>
            {Contact?.map((item,idex)=>(
                                <tr>
                                <td>{item.username}</td>
                                <td></td>
                                <td></td>
                                <td></td>
                                <td>
                                  <img src=""></img>
                                </td>
                              </tr>
              ))} 

          </table>
        </Div>
      </Div>
    </>
  );
}

export default Contact;
